// A component (Custom) in React is Javascript function
// Can only have 1 root element per return statement/snippet
// Can use a div within a div
const InsuranceDetails = {date: 'March 28th', insurance: 'Outsurance', price: '235'};

function ExpenseItem() {
    return (
    <div> 
        <div>{InsuranceDetails.date}</div>
        <div>
            <h2>{InsuranceDetails.insurance}</h2>
            <div>{InsuranceDetails.price}</div>
        </div>
    </div>
    )
}

export default ExpenseItem;
